import React, { useState } from "react";
import { Tasks } from "./components/Tasks/tasks.jsx";

import "./App.scss";


const App = () => {
  let [tasks, setTasks] = useState([
    {
      id: 1,
      title: "Aprender HTML",
      complete: true
    },
    {
      id: 2,
      title: "Aprender CSS",
      complete: true,
    },
    {
      id: 3,
      title: "Aprender javaScript",
      complete: true
    },
    {
      id: 4,
      title: "Aprender React",
      complete: false
    }
  ])
	return (
		<div>
			<div className="container">
        <Tasks />
      </div>
		</div>
	)
}

export default App;
